package Q3372;

import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.math.BigInteger;
import java.util.StringTokenizer;

/**
 * 보드 점프
 */
public class Main {
    private static BigInteger[][] dp;
    private static int[][] map;
    private static int N;

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        N = Integer.parseInt(br.readLine());
        map = new int[N + 1][N + 1];
        dp = new BigInteger[N + 1][N + 1];
        for (int i = 1; i <= N; i++) {
            StringTokenizer st = new StringTokenizer(br.readLine());
            for (int j = 1; j <= N; j++) {
                map[i][j] = Integer.parseInt(st.nextToken());
                dp[i][j] = BigInteger.valueOf(-1L);
            }
        }
        BigInteger answer = dfs(1, 1);
        System.out.println(answer);
    }

    private static BigInteger dfs(int i, int j) {
        if (i == N && j == N) {
            return BigInteger.ONE;
        }

        if (!dp[i][j].equals(BigInteger.valueOf(-1L))) {
            return dp[i][j];
        }

        dp[i][j] = BigInteger.ZERO;
        if (i + map[i][j] <= N) {
            dp[i][j] = dp[i][j].add(dfs(i + map[i][j], j));
        }

        if (j + map[i][j] <= N) {
            dp[i][j] = dp[i][j].add(dfs(i, j + map[i][j]));
        }

        return dp[i][j];
    }
}
